import React from 'react';
import Card from './Card';

const CardList = ({ kanji }) => {
	const cardComponent = kanji.map((kanji, i) => { 
		return <Card character={kanji[i].character} reading={kanji[i].kunyomi+" "+kanji[i].onyomi} meaning={kanji[0].meaning} />
	}
)

	return(		
		<div>
			<Card character={kanji[0].character} reading={kanji[0].kunyomi+" "+kanji[0].onyomi} meaning={kanji[0].meaning} />
			<Card character={kanji[1].character} reading={kanji[1].kunyomi+" "+kanji[1].onyomi} meaning={kanji[1].meaning} />
			<Card character={kanji[2].character} reading={kanji[2].kunyomi+" "+kanji[2].onyomi} meaning={kanji[2].meaning} />
			<Card character={kanji[3].character} reading={kanji[3].kunyomi+" "+kanji[3].onyomi} meaning={kanji[3].meaning} />
		</div>

	);
}

export default CardList;
